import React, { Suspense } from "react";
import Loadable from "react-loadable";

import "./App.css";
import Price from "../Componets/Price";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import Spinner from "react-bootstrap/Spinner";

import ChatbotComponent from '../Componets/Chatbot'

import { Provider } from "react-redux";
import { store } from "../redux/store";

const dynamicImport = (importingComponent) =>
  Loadable({
    loader: importingComponent,
    loading: Spinner,
  });


const ListHistory = dynamicImport(() => import("../Componets/ListHistory"));


import { useDispatch } from 'react-redux';
import { Chatbot } from 'react-chatbot-kit';

import config from '../../Config/';
import MessageParser from '../../MessageParser';
import ActionProvider from '../../ActionProvider';

const App = () => {
  return (
    <Provider store={store}>
      <div>
        <Chatbot />

      </div>
    </Provider>
  );
};


